window.bookSummaryJSON = "<p>A rogue Russian nuke sails toward the harbors of Los Angeles in the hull of a ramshackle sailboat. Without destroying a single building, the bomb shatters the latticework of the American dream, toppling one piece of the economy after another. A group of Special Forces veterans and their&nbsp;prepper&nbsp;friends scramble for survival in a worldwide catastrophe so psychologically&nbsp;disruptive&nbsp;they are left questioning everything they ever believed to be true.</p>"; 
